import React from "react"

const Input = ({ label, name, onChange, user }) => {
  const handleChange = (e) => {
    onChange(e.target.name)
  }
  return (
    <div>
      <label>{label}</label>
      <input onChange={(e) => handleChange(e)} name={name}></input>
    </div>
  )
}

export default Input
